import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Falls vorhanden
import App from './App';
import { createTheme, ThemeProvider } from '@mui/material/styles';

// Theme erstellen
const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2', // Blau (Primary)
    },
    secondary: {
      main: '#ff4081', // Pink (Secondary)
    },
    background: {
      default: '#f5f5f5', // Hintergrundfarbe
    },
  },
  typography: {
    fontFamily: 'Roboto, Arial, sans-serif', // Standard-Schriftarten
    h1: {
      fontSize: '2.5rem', // Schriftgröße für h1
    },
  },
});

ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <App />
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
